import React from 'react';
import './Introduction.css';

function Introduction() {
  return (
    <div className="Introduction">
      <div className="Photo">

        <img src="photo_LucasG.jpg" alt="Your Photo" />
      </div>
      <div className="TextZone">
        <h1>My name is Lucas, I’m 33 years old and I am a student
          in 2nd year of Computer Science.
        </h1>
        <p>After 10 year being an optician, a team manager and even an
          optics teacher, I’ve started a Computer Science Bachelor’s
          Degree in full-time at the University of Québec, Gatineau (QC)
          in January 2023, and I’m looking for a first experience.
          On this page, you will find the information on why I would make a good
          asset in your team.
          Lucas.
        </p>
      </div>
    </div>
  );
}

export default Introduction;
